        <h1 id="introduction">Introduction</h1>
<p>The WeLore API allows creators, brands, and communities to integrate a gamified loyalty system without writing code. It handles users, missions, digital rewards, collectibles, custom currencies, and seasonal narratives — all designed to turn every interaction into part of your brand story.</p>
<aside>
    <strong>Base URL</strong>: <code>https://api-weafinity.madfenix.com</code>
</aside>
<p>Welcome to the WeLore API — a powerful and flexible system that transforms engagement into legacy. With WeLore, you don't just reward your audience with points; you invite them to co-write your universe. Through customizable tokens, unique items, missions, tiers, and lore-driven seasons, the API helps you retain and grow your community authentically. Whether you're a content creator, indie brand, or digital educator, WeLore gives you full control to build a living ecosystem around your values and audience.</p>
<aside>
Let’s turn your fans into part of your legend.
</aside>

        <h1 id="authenticating-requests">Authenticating requests</h1>
<p>To authenticate requests, include an <strong><code>Authorization</code></strong> header with the value <strong><code>"Bearer {ACCESS_TOKEN}"</code></strong>.</p>
<p>All authenticated endpoints are marked with a <code>requires authentication</code> badge in the documentation below.</p>
<p>You can retrieve your token by visiting your dashboard and clicking <b>Generate API token</b>.</p>

